import React, { Component } from "react";
import { Dropdown, DropdownButton, ButtonGroup } from "react-bootstrap";
import SearchBarwithShowVDS from "./SearchBarwithShowVDS";
export default class ShowVideos extends Component {
    constructor(props) {
        super(props);
        this.state = {
            ApiRes: this.props
        };
    }

    MP3=(v)=>{
    alert('i am clicked')

    }
    MP4=(v)=>{
        alert('i am clicked')

        }
        HD=(v)=>{
            alert('i am clicked')

            }
    render() {
        return (
            <div className="tmShowvideos">
                <SearchBarwithShowVDS />
                <br/>
                <div class='container my-3' align='center'>

                    {this.state.ApiRes.obj.map((e) => {
                        return (

                            <div>
                                {/* <Card style={{ width: '60rem' }}>
                                    <Card.Body> */}
                                        <div class="embed-responsive embed-responsive-16by9">
                                        <iframe  title="myFrame" width="560" height="315" src={`//www.youtube.com/embed/${e.id}`} allowFullScreen></iframe>
                                        </div>
                                        <div>
                                            <div className="mb-2" align='right'>
                                                {['up'].map((direction) => (
                                                    <DropdownButton
                                                        as={ButtonGroup}
                                                        key={direction}
                                                        id={`dropdown-button-drop-${direction}`}
                                                        drop={direction}
                                                        variant="outline-success"
                                                        title={` Download`}
                                                        className={'rounded-0'}
                                                    >
                                                        <Dropdown.Header><b>Format</b></Dropdown.Header>
                                                        <Dropdown.Divider />
                                                        <Dropdown.Item onClick={this.MP3}>MP3</Dropdown.Item>
                                                        <Dropdown.Item  onClick={this.MP4}>MP4</Dropdown.Item>
                                                        <Dropdown.Item onClick={this.HD} >HD</Dropdown.Item>
                                                    </DropdownButton>
                                                ))}
                                            </div>
                                        </div>
                                    {/* </Card.Body>
                                </Card> */}
                                <br/>
                            </div>
                        )

                    })}

                </div>

            </div >


        );
    }
}
